.notify-element {
  padding: 0.5rem 0.75rem;
  margin: 5px 0;
  word-wrap: break-word;
  text-align: left;
  display: block;
  border: 1px solid transparent;
}

.notify-element .notification-header {
  margin: 0;
  padding: 0;
  line-height: 1.4;
  font-size: 0.86667rem;
  margin-bottom: 0.25rem;
  color: #304453;
}

.notify-element .created-at {
  line-height: 1;
  margin: 0;
  margin-bottom: 0.25rem;
  color: #4A4A4A;
  font-size: 0.73333rem;
}

.notify-element:hover {
  border-color: rgba(0, 150, 213, 0.5);
}

.notify-element :hover {
  color: #304453 !important;
}

.info {
  background-color: #F2FAFE;
}

.warning {
  background-color: lightcoral;
}

